shaders.vertex:
// Crosshatch effect vertex shader
	   
attribute vec4 aVertex;
attribute vec4 aTexCoord;
varying vec4 vTexCoord;

uniform bool uFlip; // false

void main(void)
{
    vTexCoord = aTexCoord;
    if (uFlip)
      vTexCoord.y = 1.0 - aTexCoord.y;
    gl_Position = aVertex;
}

shaders.fragment:
// Crosshatch effect fragment shader

const float SQRT2 = 1.41421356237;

varying vec4 vTexCoord;
uniform sampler2D uTexture;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;
uniform vec2 uMarks[];
uniform int uStitchSize; // 3, 40, 7
uniform bool uInvert; // true
uniform float uPulseSpeed; // 1, 10, 5
uniform float uPulseStrength; // 0, 1, 0.5
uniform float uLightness; // 0, 3, 1

vec4 crosshatch(sampler2D tex, vec2 uv, vec2 resolution, int stitchSize, bool invert)
{
  float stitch = -float(stitchSize);
  vec4 c = vec4(0.0);
  vec2 cPos = uv * resolution;
  vec2 tlPos = floor(cPos / stitch) * stitch;
  int remX = int(mod(cPos.x, stitch));
  int remY = int(mod(cPos.y, stitch));
  if (remX == 0 && remY == 0)
    tlPos = cPos;
  vec2 blPos = tlPos;
  blPos.y += stitch - 1.0;
  if ((remX == remY) || 
     (((int(cPos.x) - int(blPos.x)) == (int(blPos.y) - int(cPos.y))))) 
  {
    if (invert)
      c = vec4(0.2, 0.15, 0.05, 1.0);
    else
      c = texture2D(tex, tlPos / resolution) * SQRT2;
  }
  else {
    if (invert)
      c = texture2D(tex, tlPos / resolution) * SQRT2;
    else
      c = vec4(0.0, 0.0, 0.0, 1.0);
  }
  return c;
}

void main(void)
{
  vec4 color = crosshatch(uTexture, vTexCoord.st, uResolution, uStitchSize, uInvert);
  gl_FragColor = uLightness * color * vec4(1.0, 0.5 + uPulseStrength * sin(uPulseSpeed * uT), 1.0, 1.0);
}
